import React from 'react';
import './FaceRecognition.css'

const FaceRecognition = ({ imageUrl, boxes }) => {
    return (
        <div className="center ma">
            <div className="absolute mt2">
                <img id="inputimage" src={imageUrl} width='500px' height="auto"></img>
               {
                   boxes.map((box, i) => {
                       const { topRow, rightCol, bottomRow, leftCol } = box;
                       return (<div key={i} id="face" className="bounding-box" style={{leftCol:leftCol, topRow:topRow, rightCol:rightCol, bottomRow:bottomRow}}></div>)
                   })
               }
            </div>
        </div>
    )
}

export default FaceRecognition;
